import React, { Component } from 'react';

class Form extends Component {
	constructor(){
		super ()
 	}

render(){
	return (
	 <form id="contact-form" method="POST"> 
	  <div>
	   <label htmlFor="name">Name</label>
	   <input type="text" className="form-control" />
	  </div>
	 </form>
	)
 }
}
export default Form;
